import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import LandingPage from './components/landingpage'; // Existing component
import HomePage from './components/homepage';     // Updated homepage with sidebar and navigation
import InvoiceList from './components/invoice_list'; // Keeping for future use
import Dashboard from './components/dashboard';     // Keeping for future use

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
          {/* Redirect root to homepage */}
          <Route path="/" element={<Navigate to="/landingpage" />} />

          {/* Landing Page */}
          <Route path="/landing" element={<LandingPage />} />

          {/* HomePage with Sidebar */}
          <Route path="/homepage/*" element={<HomePage />} />

          {/* Future routes (optional placeholders) */}
          <Route path="/login" element={<HomePage />} />
          <Route path="/invoices" element={<InvoiceList />} />
          <Route path="/dashboard" element={<Dashboard />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
